import React, { useEffect, useState } from 'react';
import Table from './Table';

// import './App.css';


function App() {
  const [ state, setState ] = useState({});

  useEffect (() => {
    fetch('/data')
      .then((response) => response.json())
      .then((data) => setState({ data }));
  }, []);

  return (
    <div className="App">
      <Table data={state.data} />
    </div>
  );
}

export default App;
